INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (7, 5, 1, 1, 4.19, 3, 12300152, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 9, 3001, 2, 0, "vo_minigame_1012_result_1084");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (1, 5, 1, 1, 0.0, 3, 12300153, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 9, 3001, 2, 0, "vo_minigame_1012_result_1085");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 5, 1, 1, 2.63, 3, 12300154, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 9, 3001, 2, 0, "vo_minigame_1012_result_1086");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 1, 1, 1, 5.53, 1, 12300155, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 4, 3001, 2, 0, "vo_minigame_1012_result_1087");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 1, 3, 1, 0.01, 1, 12300156, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 4, 3001, 2, 9, "vo_minigame_1012_result_1088");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 1, 1, 1, 4.15, 1, 12300157, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 4, 3001, 2, 3, "vo_minigame_1012_result_1089");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (9, 1, 9, 1, 0.01, 2, 12300158, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 4, 3001, 2, 9, "vo_minigame_1012_result_1090");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 1, 1, 1, 5.37, 2, 12300159, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 4, 3001, 2, 0, "vo_minigame_1012_result_1091");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 1, 1, 1, 1.44, 2, 12300160, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 4, 3001, 2, 0, "vo_minigame_1012_result_1092");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 1, 3, 1, 0.0, 3, 12300161, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 4, 3001, 2, 0, "vo_minigame_1012_result_1093");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 1, 9, 1, 2.91, 3, 12300162, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 4, 3001, 2, 3, "vo_minigame_1012_result_1094");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (5, 1, 1, 1, 2.61, 3, 12300163, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 4, 3001, 2, 0, "vo_minigame_1012_result_1095");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (4, 0, 2, 1, 3.63, 1, 12300164, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 0, 3001, 2, 1, "vo_minigame_1012_result_1096");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (6, 0, 2, 1, 4.16, 1, 12300165, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 0, 3001, 2, 1, "vo_minigame_1012_result_1097");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 0, 3, 1, 0.01, 1, 12300166, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 0, 3001, 2, 6, "vo_minigame_1012_result_1098");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (6, 0, 2, 1, 5.75, 2, 12300167, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 0, 3001, 2, 0, "vo_minigame_1012_result_1099");
