INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (8, 0, 4, 1, 5.73, 2, 12300169, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 0, 3001, 2, 8, "vo_minigame_1012_result_1101");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (5, 0, 3, 1, 5.32, 3, 12300170, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 0, 3001, 2, 1, "vo_minigame_1012_result_1102");
INSERT INTO `v1_532a7bc48bb95baa0723b9e53d51bd9bc132aca798d1634641fe43714549d2c8` VALUES (3, 0, 9, 1, 2.37, 3, 12300171, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 0, 3001, 2, 9, "vo_minigame_1012_result_1103");
